import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Users = () => {
  const [users, setUsers] = useState([]);
  const [selectedUser, setSelectedUser] = useState(null);

  const [username, setUsername] = useState(''); // Add state for username
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [dob, setDob] = useState(''); // Add state for date of birth

  useEffect(() => {
    async function fetchUsers() {
      const response = await axios.get('http://localhost:3001/users');
      setUsers(response.data);
    }

    fetchUsers();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const newUser = {
      username, // Include username in the user object
      firstName,
      lastName,
      email,
      dob, // Include date of birth in the user object
    };

    const response = await axios.post('http://localhost:3001/users', newUser);
    if (response.status === 200) {
      setUsers([...users, newUser]);
      setUsername(''); // Clear the username field
      setFirstName('');
      setLastName('');
      setEmail('');
      setDob(''); // Clear the dob field
    }
  };

  const handleUserClick = async (userId) => {
    const response = await axios.get(`http://localhost:3001/users/${userId}`);
    setSelectedUser(response.data);
  };

  return (
    <div>
      <h2>Create New User</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Username:</label>
          <input
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
        </div>
        <div>
          <label>First Name:</label>
          <input
            value={firstName}
            onChange={(e) => setFirstName(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Last Name:</label>
          <input
            value={lastName}
            onChange={(e) => setLastName(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Date of Birth:</label>
          <input
            type="date"
            value={dob}
            onChange={(e) => setDob(e.target.value)}
            required
          />
        </div>
        <button type="submit">Add User</button>
      </form>

      <h2>Users List</h2>
      <ul>
        {users.map((user) => (
          <li key={user.userId} onClick={() => handleUserClick(user.userId)}>
            {user.username} - {user.firstName} {user.lastName}
          </li>
        ))}
      </ul>

      {selectedUser && (
        <div>
          <h3>Selected User Details</h3>
          <p>Username: {selectedUser.username}</p> {/* Display username */}
          <p>First Name: {selectedUser.firstName}</p>
          <p>Last Name: {selectedUser.lastName}</p>
          <p>Email: {selectedUser.email}</p>
          <p>Date of Birth: {selectedUser.dob}</p> {/* Display dob */}
        </div>
      )}
    </div>
  );
};

export default Users;
